import React, {Component} from "react";
import axios from 'axios'

export default class CataloguePage extends Component {
    state = {
        photos: []
    }
    
    componentDidMount() {
        axios.get('https://jsonplaceholder.typicode.com/photos?_page=1')
            .then(res=> {
                const photos = res.data
                this.setState({photos})
            })
    }
    
    
        render() {
            return(
                <div className="container"><div className="row">
                    {
                    this.state.photos
                        .map(photo=> 
                            <div className="col s3"><img alt={photo.id} src={photo.thumbnailUrl}></img></div>
                        )
                    }
                </div>
            </div>
            )
        }
    }
